webpackJsonp([0xad80f7377570],{3518:function(a,t){a.exports={data:{markdownRemark:{html:'<p>これでジタクからネットできる!! わーい 次回バージョンアップ予告は<a href="/mk-iik">Mk-IIK</a>と<a href="/km-iik">Km-IIK</a>です。今回は<a href="/filez/app/MSD2K.txt">6パネ用拡張MSD</a>と<a href="/filez/app/kmanibms.txt">24key用拡張BMSのフォーマット</a>を公開! もし競合する予約語、ほか意見などございましたらメール下さい♪</p>\n<h2>6 Arrowne 2K について</h2>\n<p>……最初AM-3Pで「け、決定出来ねーぞ!!」ってEnterやSpace連打しませんでしたか?まだ16分非対応なんです。つーか、データの先頭からのバイト数で矢印の位置を決めてるもんだからMSDコンパイラを1から書きなおさなきゃいけないという、悲惨な状況です。でも、次か次の次あたりで()はおろか[]や{}にもちゃぁーんと対応させますよー ところで読みは厳密にはarrowとaloneが組み合わさった造語ですので「あろ～ん」と言うのが正しいのですが、「あろーね」ってゆのも悪くないなぁ……正式バージョンではどっちの読みをとろうか……なんかつけてほしい機能があったら色々言ってください。1.0以降は要望によってのみバージョンアップする予定ですので。(今回は「ビートカウンタ」といういかにも無駄な機能が……)</p>',frontmatter:{cover:null,date:"2000-03-20T18:12:00+09:00",strDate:"2000/3/20",title:"TAゲット!!"}}},pathContext:{path:"/ja/blog/2000/03/20-bought-terminal-adapter/",langKey:"ja"}}}});
